const jwt = require('jsonwebtoken')
const passport = require('passport')
const Strategy = require('passport-local').Strategy

import bcrypt from 'bcrypt';

const jwtSecret = process.env.JWT_SECRET || 'myjwt'
const adminPassword = process.env.ADMIN_PASSWORD || 'secret'
const jwtOpts = { algorithm: 'HS256', expiresIn: '30d' }
import models from '../models/init-models'

passport.use(adminStrategy())
const authenticate = passport.authenticate('local', { session: false })

module.exports = {
    authenticate,
    login: login,
    ensureAdmin: ensureAdmin,
    ensureSeller : ensureSeller
}


async function login(req, res, next) {
    const token = await sign({ username: req.user.username,roleType:req.user.roleType });
    const {userId,username,email,roleType} = req.user;
    res.cookie('jwt', token, { httpOnly: true })

    res.json({ profile: {userId,username,email,roleType},success: true, token: token })
}

async function sign(payload) {
    const token = await jwt.sign(payload, jwtSecret, jwtOpts)
    return token
}

async function ensureSeller(req, res, next) {
    const jwtString = req.headers.authorization || req.cookies.jwt
    const payload = await verify(jwtString)
    if(payload.username){
        req.user = payload;
        if(req.user.roleType === 'Seller') req.isSeller = true;
        return next();
    }

    const err = new Error('Unauthorized');
    err.statusCode = 401;
    next(err);
}

async function ensureAdmin(req, res, next) {
    const jwtString = req.headers.authorization || req.cookies.jwt
    const payload = await verify(jwtString)
    if (payload.username === 'admin') return next()
    const err = new Error('Unauthorized')
    err.statusCode = 401
    next(err)
}

async function verify(jwtString = '') {
    jwtString = jwtString.replace(/^Bearer /i, '')
    try {
        const payload = await jwt.verify(jwtString, jwtSecret)
        return payload
    } catch (err) {
        err.statusCode = 401
        throw err
    }
}

function adminStrategy() {

    return new Strategy(async function (username, password, cb) {
        try {
            const result = await models.users.findOne({
                where: { user_name: username }
            });
            
            const { user_name,user_id,user_firstname,user_lastname,user_password,user_email,user_phone } = result.dataValues;
            const compare = await bcrypt.compare(password, user_password);

            if (compare) return cb(null, { username: user_name, user_firstname: user_firstname, user_lastname: user_lastname, userId: user_id, email: user_email, user_phone: user_phone})
        } catch (error) {
            console.log(error);
        }

        cb(null, false)
    })
}

